import { Injectable } from "@angular/core";

@Injectable({
  providedIn: "root",
})
export class CounterService {
  count: number = 0;
  constructor() {}

  incrementCount() {
    this.count++;
    console.log(this.count);
  }

  decrementCount() {
    this.count--;
  }

  inputValChange(data: number) {
    this.count = data;
  }

  resetCount() {
    this.count = 0;
  }
}
